function transfer(address _to, uint256 _value) public returns (bool) {
    address sender = msg.sender;
    if (balances[sender] < _value) {
        return false;
    }
    if (_value <= 0) {
        return false;
    }
    balances[sender] -= _value;
    balances[_to] += _value;
    emit Transfer(sender, _to, _value);
    return true;
}
